import React, { useState } from 'react';

const EvolutionStage = ({ pokemon }) => {
    const [pokemonStage, setPokemon] = useState(null);

    const fetchEvolution = () => {
        fetch(pokemon.url)
            .then(async res => {
                const currentPhasePokemon = await res.json();
                setPokemon(currentPhasePokemon);
            })
    }

    useEffect(() => fetchEvolution(), []);

    return (
        <div>Evolution Stage</div>
    )
}

export default EvolutionStage;
